export const environment = {
  production: false,
  youtubeConfig: {
    defaultSearchOptions: {
      order: 'date' as const,
      videoDefinition: 'high' as const,
      videoDuration: 'medium' as const,
      maxResults: 12,
      videoCategoryId: '24', // Entertainment
    },
    categories: [
      { id: 'cinema', name: 'Cinema', videoCategoryId: '24' },
      { id: 'Food', name: 'food', videoCategoryId: '24' },

      { id: 'music', name: 'Music', videoCategoryId: '10' },
      { id: 'news', name: 'News', videoCategoryId: '25' },
      { id: 'tech', name: 'Technology', videoCategoryId: '28' },
      { id: 'education', name: 'Education', videoCategoryId: '27' }
    ]
  }
};
